import logo from './logo.svg';
import './App.css';

function App() {

  const [videoId, setVideoID] = useState(null);
  console.log("sent");
  useEffect(() =>{
    fetch("./getRandomVideo").then(function(data){
      console.log(data);
      console.log("received");
      return data.json();
    }).then(function(obj){
      console.log("2nd then");
      console.log(obj);
      setVideoID(obj.data);
    });
  })


    return (
      <div className="App">
